import Phaser from 'phaser'
import Taxi from "./Taxi"

/**
 * Plugins are needed for new classes, however it does not work yet....
 */

class TaxiPlugin extends Phaser.Plugins.BasePlugin {
    constructor (pluginManager)
    {
        super(pluginManager);

        //  Register our new Game Object type
        pluginManager.registerGameObject('TaxiPlugin', this.createTaxi);
    }

    createTaxi (x, y, identifier)
    {
        return this.displayList.add(new Taxi(this.scene, x, y, identifier));
    }
}
